import axios from "axios";
import styles from "./Diets.module.css";

export default function Diets() {
  axios.get("http://localhost:3001/diets").then(({ data }) => {
    let dietas = data.flatMap((element) => element.name);
    return dietas;
  });

  return <div className={styles.Contenedor}>asdas</div>;
}
